import React from 'react';
import { Video } from './components/Video';

function App() {
  const constraints = {
    video: true,
    audio: true,
  };
  navigator.mediaDevices
    .getUserMedia(constraints)
    .then((stream) => {
      console.log('Got MediaStream:', stream);
    })
    .catch((error) => {
      console.error('Error accessing media devices.', error);
    });

  return <Video />;
}

export default App;
